import React, { useState } from 'react'
import axios from 'axios';
import { Input, Ripple, initMDB } from "mdb-ui-kit";
import {useNavigate } from 'react-router-dom';

initMDB({ Input, Ripple });
function AddBooks({fetch}) {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
     const navigate = useNavigate();
    const[author,setAuthor]=useState("")
    const[title,setTitle]=useState("")
    const[description,setDescription]=useState("")
    const[category,setCategory]=useState("")
    const[trending,setTrending]=useState()
    const[coverImage,setCoverImage]=useState("")
    const[Price,setPrice]=useState("")
    const[createdAt,setCreatedAt]=useState("")
    const addbooks=(obj)=>{
        const token = localStorage.getItem('token'); 
              axios.post("http://localhost:4000/api/book/add",obj,{
                headers: {
                  Authorization: `Bearer ${token}`
                }
      })
              
              .then(()=>{
                  console.log("books added")
                  
                  if (token) {
                    setIsAuthenticated(true);
                    fetch();
                    navigate("/main")
                  }
      
              }).catch((error)=>{
                throw error
              })
          }
      
      
      
    
  return (
    <div className='container'>
   <nav className="navbar navbar-expand-lg bg-body-tertiary custom-navbar">
        <div className="container-fluid">
          <a className="navbar-brand custom-navbar-brand" href="#">Navbar</a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link active custom-nav-link" aria-current="page" href="#">Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link active custom-nav-link" onClick={() => navigate("/add")}>AddBooks</a>
              </li>
              <li className="nav-item">
                <a
                  className="nav-link active custom-nav-link"
                  onClick={() => navigate("/")}
                >
                  Logout
                </a>
              </li>
            </ul>
            <form className="d-flex custom-search-form" role="search" onSubmit={(e) => e.preventDefault()}>
              <div>
                <input
                  type="text"
                  value={query}
                  onChange={(e) => setQuery(e.target.value)}
                  placeholder="Search by title, author, or other fields"
                />
                <button type="button" onClick={handleSearch}>Search</button>
              </div>
            </form>
          </div>
        </div>
      </nav>
      <form>

  <div className="row mb-4">
    <div className="col">
      <div data-mdb-input-init className="form-outline">
        <input type="text" id="form6Example1" className="form-control" placeholder='author' defaultValue={author} onChange={(e)=>setAuthor(e.target.value)} />
        
      </div>
    </div>
    <div className="col">
      <div data-mdb-input-init className="form-outline">
        <input type="text" id="form6Example2" className="form-control" placeholder='title' defaultValue={title} onChange={(e)=>setTitle(e.target.value)} />
      </div>
    </div>
  </div>
  <div data-mdb-input-init className="form-outline mb-4">
    <input type="text" id="form6Example3" className="form-control" placeholder='description' defaultValue={description} onChange={(e)=>setDescription(e.target.value)} />
  </div>

  <div data-mdb-input-init className="form-outline mb-4">
    <input type="text" id="form6Example3" className="form-control" placeholder='category' defaultValue={category} onChange={(e)=>setCategory(e.target.value)} />
  </div>


  <div data-mdb-input-init className="form-outline mb-4">
    <input type="text" id="form6Example4" className="form-control" placeholder='trending' defaultValue={trending} onChange={(e)=>setTrending(e.target.value)}  />
  </div>


  <div data-mdb-input-init className="form-outline mb-4">
    <input type="text" id="form6Example5" className="form-control" placeholder='coverImage' defaultValue={coverImage}  onChange={(e)=>setCoverImage(e.target.value)} />
  </div>


  <div data-mdb-input-init className="form-outline mb-4">
    <input type="text" id="form6Example6" className="form-control" placeholder='Price' defaultValue={Price} onChange={(e)=>setPrice(e.target.value)} />
  </div>


  <div data-mdb-input-init className="form-outline mb-4">
  <input type="text" id="form6Example6" className="form-control" placeholder='createdAt' defaultValue={createdAt} onChange={(e)=>setCreatedAt(e.target.value)} />
  </div>
  
  <div className="form-check d-flex justify-content-center mb-4">
   
  </div>

  <button data-mdb-ripple-init type="button" className="btn btn-primary btn-block mb-4" onClick={()=>addbooks({author,title,description,category,trending,coverImage,Price,createdAt})}  >add</button>
</form>
    </div>
  )
}

export default AddBooks
